import React, { Component } from 'react'
import Form from './Form'
export default class AboutUs extends Component {
  render() {
    return (
      <div>
        <div className="jumbotron jumbotron-fluid">
          <div className="container">
            <h1 className="display-4 my-4">“What is now proved was once only imagined.” </h1>
            <hr />
            <p className="lead my-4">With us Learning and innovation go hand in hand. The arrogance of success is to think that what you did yesterday will be sufficient for tomorrow.</p>

            <button type="button" class="btn btn-warning mx-auto">Warning</button>
          </div>
        </div>
      </div>
    )
  }
}
